import React from "react";
import Lap from "./Lap";
import { Link } from "react-router-dom";

const Desktops = (props) => {
  return (
    <>
      {props.desktops.map((desktops, id) => (
        <Link to={`/blogs/${desktops.id}`}>
          <Lap key={id} desktops={desktops} />
        </Link>
      ))}
    </>
  );
};

export default Desktops;
